import React,{useState} from "react";
import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import ExpensesFilter from "../ExpenseFilter/ExpensesFilter";



function Expenses(props)
{
    const [filterYear, setFilterYear] = useState("2021");
    const selectHandler = (selectedYear) =>{
        console.log("Expenses.js");
        setFilterYear(selectedYear);
        console.log(filterYear,selectedYear);
    };

    // const expenseMapper = (expense)=>{
    //     
    // };

    return (
        <Card className="expenses">
            <ExpensesFilter selected={filterYear} onSelect={selectHandler}/>
            { console.log("in expenses.js",props.items) }
            {props.items.filter(item => item.date.getFullYear == filterYear)
            
            .map( expense => 
            <ExpenseItem 
                key={expense.id}
                title={expense.title} 
                amount={expense.amount} 
                date={expense.date} 
            />)
            }; 
            
        </Card>
    );
}

export default Expenses;
